import './App.css';
import React, {useState} from "react";
import HeaderComponent from './Header';
import Forms from './Forms';

function App() {

  const [list, setList] = useState([]);

  function onSubmit(item) {
    let tmp = list.push(item)
    console.log(tmp);
    setList(tmp)
  }

  return (
    <div>
      <HeaderComponent tag="h1" text="What's the Plan for Today?" />
      <center>
        <Forms
          placeholder="Enter some plan"
          text="Add"
          Color="White"
          onSubmit={onSubmit}
        />
      </center>
    </div>
  );
}

export default App;
